import React from "react";
import { Document} from "react-pdf";
import resume from "../images/Resume.pdf";

function Resume(){
    return(
     <div className="container my-3">
         <Document file={resume} 
         >
         </Document>
         {resume && <iframe src={resume} />}
     </div>
    );
}

export default Resume;
